// src/components/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div>
      <h2>Dashboard</h2>
      <nav>
        <ul>
          <li>
            <Link to="/products">Manage Products</Link>
          </li>
          <li>
            <Link to="/users">Manage Users</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Dashboard;
